import React, { Component } from 'react';

class Resume extends Component {
  render() {
    return (
      <div>
        <h1>Resume Page</h1>
        <a
          style={{ color: 'white' }}
          href='path_to_file'
          download='proposed_file_name'
        >
          Download
        </a>
      </div>
    );
  }
}

export default Resume;
